  `groupId` int(11) DEFAULT NULL,
  `prefix` varchar(5) DEFAULT NULL,
  `basic_detail` int(11) DEFAULT NULL,
  PRIMARY KEY (`profileId`),
  KEY `user_profile_addressId` (`address_id`),
